import { useEffect, useState } from "react"
import axios from 'axios';
import '../styles/Read.css';
function Read() {

    const [players, setPlayers] = useState([])
    useEffect(() => {
        const fetchAllPlayers = async () => {
            try {
                const response = await axios.get("http://localhost:8080/read")
                // console.log(response)
                console.log(response.data[0].playerName) // Hadrian stein
                setPlayers(response.data)
            } catch (err) {
                console.log("error occured while fetching data");
            }
        }
        fetchAllPlayers()
    }, [])
    console.log(players);
    return (
        <div className="Read">
            <div className="tag">
                <h1>Free<span>Fire</span></h1>
            </div>
            {players.map(detail => (
                <div key={detail.id} className="player">
                    <h1>{detail.playerName}</h1>
                    <p>Match played : {detail.matchesPlayed}</p>
                    <p>Total kills : {detail.kills}</p>
                    <p>Matchs won : {detail.matchWon}</p>
                    <p>Most used Weapon : {detail.weapon}</p>
                    <button>Delete Player</button>
                    <button>Update Player</button>
                </div>
            ))}
        </div>
    )
}

export default Read
